import React from 'react';
import './Course.css'
const Course = (props) => {
    const {name, price, session, description,img} = props.course;
    return (
        <div className="course-info">
            <img src={img}></img>
            <h3>{name}</h3>
            <p>{description}</p>
            <p>{session} sessions</p>
            <h4>${price}</h4>
        </div>
    );
};

export default Course;
